import React, { useState } from "react";
import Shildecomponent from "./shildecomponent";

export default function Test13(){
const [longauge ,setlongauge]=useState("")

const handleswitch =()=>{
    switch(longauge){
        case 'Ar' : return "salam 3alaykom"
         case Fr :return "Bonjour"
        case Eng :  return "Hello"
        case Span : return "Span"

    }
}
    return (
        <>


        <Shildecomponent onlongaugechange={value =>{setlongauge(value)}}/> 

           <h5> language est : {handleswitch()}</h5>
          
        
        </>
    )
}
